import React from 'react';
import logo from '../img/logo.svg'

const SidebarLeft = () => {
    return (
        <div className=' bg-slate-700'>
           <div className='w-full h-[70px] '>
            <img src={logo} alt='logo'/>
           </div>
        </div>
    );
}

export default SidebarLeft;
